import React, { Component } from 'react';
import data from "./about.json";

const string = JSON.stringify(data);

class About extends Component {
	render() {
        console.log(string);
		return (
            <ul>
                {string.map(s => (<li>{s}</li>))}
            </ul>
        );
    }
} 
export default About;
